import TaskCard from "../components/TaskCard";
import "./TaskView.css"


const TaskView = ({ tasks }) => {

  return (
    <div className="task-view">

      <div className="card-container">
        {tasks.map((task) => (
          <TaskCard task={task} />
        ))}
      </div>
    </div>



  );



};
export default TaskView;
